import React from 'react';
import Navbar from 'react-bootstrap/Navbar';

const Header = () => {
    return (
            <Navbar bg="light" variant="light">
                <Navbar.Brand href="/">Images Gallery</Navbar.Brand>
            </Navbar>
    )
};

export default Header;
